<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 1452 813">
    <defs>
        <style>

            .a, .b, .d {
                isolation: isolate;
            }

            .b {
                opacity: 0.75;
                mix-blend-mode: multiply;
                -webkit-transition: all .3s ease;
                transition: all .3s ease;
            }

            .c, .d {
                fill: #fff;
                -webkit-transition: all .3s ease;
                transition: all .3s ease;
            }

            .d {
                font-size: 40px;
                font-family: 'Lato-Medium', 'Lato';
            }

            .d {
                letter-spacing: -0.02em;
            }

            .e {
                opacity: 0.75;
                mix-blend-mode: multiply;
            }

            .f {
                font-family: 'Lato-Regular', 'Lato';
                font-size: 18px;
            }

            .i {
                fill: #3a85c0;
            }

            .r {
                fill: #fff;
                -webkit-transition: all .3s ease;
                transition: all .3s ease;
            }

            .description {
                visibility: hidden;
                opacity: 0;
                -webkit-transition: all .3s ease;
                transition: all .3s ease;
            }

            #MSC, #STP, #UFA {
                cursor: pointer;
            }

            #MSC:hover .description,
            #STP:hover .description,
            #UFA:hover .description {
                visibility: visible;
                opacity: 1;
            }

            #MSC:hover .b,
            #STP:hover .b,
            #UFA:hover .b {
                opacity: 0;
            }

            #MSC:hover .c, #MSC:hover .d,
            #STP:hover .c, #STP:hover .d,
            #UFA:hover .c, #UFA:hover .d {
                opacity: 0.6;
            }

        </style>
    </defs>
